    res.send({creado:usuarioCreado.protocol41, mensaje: "Usuario creado correctamente"});
  }).catch((e)=>{
    res.send(e);
  })
});

router.get('/', function(req, res, next) {
  res.send('respond with a resource');
});

module.exports = router;

