      if (error) throw error;
      return callback(result);
    });
  },

  count: function() {
    return new Promise((resolve, reject) => {
      Mysql.query("SELECT COUNT(*) AS cantidad FROM datos", (error, result) => {
        if (error) throw error;
        resolve(result[0].cantidad);
      });
    });
