  datos: function(datosConsulta, numAleatorio, numeroObjetos) {
    return new Promise((resolve, reject) => {
      Mysql.query("SELECT "+datosConsulta+" FROM datos LIMIT "+numAleatorio+", "+numeroObjetos, (error, result) => {
        if (error) throw error;
        resolve(result);
      });
