      Mysql.query(`SELECT * FROM usuarios WHERE nombre='${usuario.nombre}' AND contrasena='${usuario.contrasena}'`, (error, result) => {
        if (error) reject(error);
        resolve(result);
      });
    });
  }

};

export {accionesDatos, accionesUsuarios};

