      isNaN(cantidadObjetos) ? (cantidadObjetos = 1) : null;
      bbddDatos.count().then(totalRegistros => {
        let numAleatorio = Math.round(Math.random() * (totalRegistros - cantidadObjetos) + cantidadObjetos);
        bbddDatos.datos(Propiedades.generarConsulta(listaPropiedades), numAleatorio, cantidadObjetos).then(result => {
            result = result.map(objeto => {
